//======= UZ_DOC (ЭПД формата ИДС) ======================================
// Получить по ID
UZ_SMS.prototype.getUZ_DOC_Of_Num = function (num_doc, callback_ok, callback_err) {
    //if (typeof callback_ok === 'function') {
    //    callback_ok(resp1);
    //}
    $.ajax({
        type: 'GET',
        url: '../../api/uz/sms/uz_doc/num_doc/' + num_doc,
        async: true,
        dataType: 'json',
        beforeSend: function () {
            AJAXBeforeSend();
        },
        success: function (data) {
            if (typeof callback_ok === 'function') {
                callback_ok(data);
            }
        },
        error: function (x, y, z) {
            if (typeof callback_err === 'function') {
                callback_err(x);
            }
            //OnAJAXError("UZ_SMS.getUZ_DOC_Of_Num", x, y, z);
        },
        complete: function () {
            AJAXComplete();
        },
    });
};

/* ----------------------------------------------------------
функции для работы с объектами
-------------------------------------------------------------*/
UZ_SMS.prototype.getValueObj = function (obj, name, lang) {
    if (lang) {
        return obj ? obj[name + '_' + lang] : null;
    } else {
        return obj ? obj[name] : null;
    }
};
//
UZ_SMS.prototype.getValueCultureObj = function (obj, name) {
    return obj ? obj[name + '_' + this.lang] : null;
};
/* ----------------------------------------------------------
функции для работы с внутреним массивом
-------------------------------------------------------------*/
//*======= UZ_SMS.list_status  (Справочник статусов документа) ======================================
UZ_SMS.prototype.getStatus_Internal_Of_Code = function (code) {
    if (this.list_status) {
        var obj = getObjects(this.list_status, 'code', code);
        return obj && obj.length > 0 ? obj[0] : null;
    }
};

UZ_SMS.prototype.getStatus_Internal_Of_Name = function (text, ftext, lang) {
    if (this.list_status) {
        var obj = getObjects(this.list_status, (lang ? ftext + '_' + lang : name), text);
        return obj && obj.length > 0 ? obj[0] : null;
    }
};

UZ_SMS.prototype.getCode_Status_Internal_Of_Name = function (text, ftext, lang) {
    var obj = this.getStatus_Internal_Of_Name(text, ftext, lang);
    return obj ? obj.code : null;
};
//
UZ_SMS.prototype.getValue_Status_Of_Code = function (code, name, lang) {
    var obj = this.getStatus_Internal_Of_Code(code);
    return this.getValueObj(obj, name, lang);
};
//
UZ_SMS.prototype.getValueCulture_Status_Of_Code = function (code, name) {
    var obj = this.getStatus_Internal_Of_Code(code);
    return obj ? obj[name + '_' + this.lang] : null;
};
//
UZ_SMS.prototype.getListStatus = function (fvalue, ftext, lang, filter) {
    var list = [];
    var list_filtr = null;
    if (this.list_status) {
        if (typeof filter === 'function') {
            list_filtr = this.list_status.filter(filter);
        } else { list_filtr = this.list_status; }
        for (i = 0, j = list_filtr.length; i < j; i++) {
            var l = list_filtr[i];
            if (lang) {
                list.push({ value: l[fvalue], text: l[ftext + '_' + lang] });
            } else {
                list.push({ value: l[fvalue], text: l[ftext] });
            }
        }
    }
    return list;
};